        var email = document.getElementById("email");
        var pssword = document.getElementById("psw");
        console.log(email.value);
        console.log(pssword.value);

    }
    return (
        <div>Kayıt

            <tr>Ad <input type="text"></input></tr>
            <tr>Soyad <input type="text"></input></tr>
            <tr>Email <input type="text" id="email"></input></tr>
            <tr>Tel <input type="text"></input></tr>
            <tr>Şİfre <input type="password" id="psw"></input></tr>
            <tr>şifre tekrar <input type="password"></input></tr>
            <tr><button onClick={print}>Go</button></tr>



        </div>
    );
};


export default signUp;
